class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        hasDuplicate= lambda x: any ( x.count(y)>1 for  y in x )
        allDuplicate= lambda y: all(y.count(x)== len(y) for  x in y)
        
        if  not s :
            return 0
        if not(hasDuplicate(s)):
            return len(s)
        
        if (allDuplicate(s)):
            return 1
        
        i=0
        repStr=""
        while i<len(s):
            restStr=s[i+1:]
            #print("restStr",restStr)
            if len(restStr)<len(repStr):
                break
            
            try:
                index=restStr.index(s[i])
            except:
                index=len(restStr)
            temp=s[i:index+i+1]
            #print("temp",temp)
            if not hasDuplicate(temp) and len(repStr)<len(temp):
                repStr=temp
                #print("repstr",repStr)
            elif hasDuplicate(temp):
                temp1=temp
                j=len(temp1)
                while ( j>0):
                    temp1=temp1[:j]
                    #print("temp 1",temp1)
                    if not hasDuplicate(temp1) and len(repStr)<len(temp1):
                        repStr=temp1
                        #("repstr else",repStr)
                        break
                    j=j-1
            i=i+1
         
        print(repStr)
        return len(repStr) 


